import classes from "./TodoList.module.css";
import Todos from "./Todos";


const TodoList: React.FC<{ text: string, idd: number, deleteId: any }> = (props) => {


  const deleteHandler =(id: number) => {
        props.deleteId(id)
  }

  return <li className={classes.item}>{props.text} 
  <button onClick={() => deleteHandler(props.idd)}>Delete</button>
  </li>
  
};

export default TodoList;
